import{_ as e,a as o,o as t,L as a}from"./chunks/framework.CKEhg_8n.js";const r="/assets/work.Bf2v7TBM.jpg",g=JSON.parse('{"title":"Ювелирный цех","description":"Ювелирный коворкинг","frontmatter":{"title":"Ювелирный цех","description":"Ювелирный коворкинг","date":"2015-10-24","cover":"cover.jpg","icon":"logo.png","vk":"jewelryzeh","instagram":"jewelryzeh","address":"Шелапутинский переулок, 3с1","place":"м. Таганская","city":"г. Moscow","coord":[55.74801389019367,37.663038912350636],"hours":"Вт-Вскр 12:00-20:00","email":"info@jzeh.ru","url":"https://jzeh.ru","tel":"+7 (968) 994-88-09","status":"open"},"headers":[],"relativePath":"workshop/catalog/jzeh/index.md","filePath":"workshop/catalog/jzeh/index.md"}'),i={name:"workshop/catalog/jzeh/index.md"},l=a('<p>Ювелирный цех работает с 2011 года, за это время мы выросли и достигли немалых успехов. У нас проводятся однодневные мастер-классы для новичков и молодоженов. Но многие наши выпускники занимаются ювелирным делом не только в рамках хобби, но и развивают собственные ювелирные бренды.</p><p>Помимо этого мы предоставляем в аренду рабочие места для коворкинга и оказываем услуги полного производственного цикла, такие как лазерная гравировка, фрезеровка мастер-моделей, литье по выплавляемым моделям, создание пресс-форм и гальванические покрытия.</p><p>Отличительной особенностью студии является свободный формат посещения: оплата почасовая, приходи, когда удобно.</p><h4 id="наши-преимущества" tabindex="-1">Наши преимущества: <a class="header-anchor" href="#наши-преимущества" aria-label="Permalink to &quot;Наши преимущества:&quot;">​</a></h4><ul><li>Удобный формат занятий;</li><li>Высокий профессионализм преподавателей;</li><li>Большое количество оборудования;</li><li>Приемлемые цены;</li><li>Большое количество обучающих и развлекательных программ: изготовление свадебных колец для влюбленных, резьба по воску, филигрань, огранка кабошонов, эмалирование горячими и холодными эмалями, лэмпворк во всем его многообразии;</li><li>Имеется возможность изготовить потрясающие стеклянные украшения из мурановского стекла (лэмпворк). Т.е. есть оборудование и преподаватель;</li><li>Творческая и душевная атмосфера.</li></ul><p>Также в студии есть все необходимое для освоения и самостоятельной работы в технике <strong>Лэмпворк</strong> (lampwork).</p><p>Лэмпворк (lampwork, flamework, bead making, лампворк, лемпворк) -  в переводе с английского языка - работа с лампой, работа в пламени, создание бусин. Это — искусство выплавления бусин из стекла в открытом пламени газовой горелки. Изготовляют бусины путем придания раскаленному стеклу различных форм. Такие украшения из стекла, выполненные в технике лэмпворк, известны также как муранское, итальянское, венецианское стекло.</p><p><img src="'+r+'" alt=""></p>',8),s=[l];function p(n,c,_,d,h,m){return t(),o("div",null,s)}const f=e(i,[["render",p]]);export{g as __pageData,f as default};
